import React from 'react'

import './header.css'



export default class Header extends React.Component {
   
    render(){
    
    const {chousePeople,chousePlanet,chouseStarShip} = this.props;    
    return(
       <div className="header d-flex">
       <h3>
           <a href >
               Star DB
           </a>
       </h3>
       <ul className="d-flex">
           <li>
               <button type="button" 
                       className="btn btn-primary"
                       onClick={chousePeople}
                       >People</button>
           </li>
           <li>
               <button type="button" 
                       className="btn btn-primary"
                       onClick={chousePlanet}
                       >Planet</button>
           </li>
           <li>
               <button type="button" 
                       className="btn btn-primary"
                       onClick={chouseStarShip}
                       >StarShip</button>
           </li>
       </ul>
       </div>
   );
};};




